package main

import "fmt"

func findAnagrams(s string, p string) []int {
	m := make(map[uint8]int)
	for i := 0; i < len(p); i++ {
		m[p[i]-'a']++
	}

	containCount := 0
	start, end := 0, 0

	ret := make([]int, 0)

	for end < len(s) {
		val, exists := m[s[end]-'a']
		if exists {
			m[s[end]-'a']--
			if val > 0 {
				containCount++
			}
		}

		// for i := start; i <= end; i++ {
		// 	fmt.Printf(string(s[i]))
		// }
		// fmt.Print("\n")

		for end-start >= len(p)-1 {
			c := s[start] - 'a'

			if val, exists := m[c]; exists {
				if end-start+1 == len(p) && containCount == len(p) {
					ret = append(ret, start)
				}

				m[c]++
				if val >= 0 {
					containCount--
				}
			}

			start++
		}
		end++
	}

	return ret
}

func main() {
	// fmt.Println(findAnagrams("cbaebabbacd", "abc"))
	// fmt.Println(findAnagrams("abab", "ab"))
	a := ""
	b := ""
	fmt.Println(len(a))
	fmt.Println(len(b))
	fmt.Println(findAnagrams(a, b))
	fmt.Println(findAnagrams("aaabaaa", "aaa"))
}
